INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (24, 2, 0.0, 10046, 102301, 24001, "2020/07/31 12:00:00", 0.0, 401, "やったね、ぷうきち！\nこれならお兄ちゃんたちの\nお手本になれたよね！", 2, "アヤネ", 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (24, 1, 0.0, 10046, 102301, 24002, "2020/07/31 12:00:00", 2.21, 402, "私たちの勝ちだね！\nぷうきちと一緒なら\nどんなボールでも\nホームランを打ってみせるよ！", 2, "アヤネ", 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (24, 2, 0.0, 10046, 102301, 24003, "2020/07/31 12:00:00", 0.0, 403, "やったやったぁ！\nお兄ちゃん、見ててくれた？\n私、すっごくがんばったよ！", 2, "アヤネ", 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (24, 2, 0.0, 10046, 192201, 24004, "2020/07/31 12:00:00", 1.99, 701, "特訓の成果が出たみたいだ！\nもっと練習を重ねて\nこの調子で上達していこう！", 1, "アサヒ", 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (24, 1, 0.0, 10046, 192201, 24005, "2020/07/31 12:00:00", 2.21, 702, "よし、いい感じだ！\nキャプテンとしての仕事は\nきっちり果たせそうだよ", 2, "アサヒ", 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (24, 2, 0.0, 10046, 192201, 24006, "2020/07/31 12:00:00", 3.33, 703, "試合に向けて\nいい感覚を掴めた気がするよ！\nこのまま一気に全国大会だ！", 1, "アサヒ", 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (24, 2, 0.0, 10046, 192301, 24007, "2020/07/31 12:00:00", 0.0, 801, "このくらい余裕だ\nオレたちは全国大会を\n目指してるんだからな", 2, "部員３", 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (24, 1, 0.0, 10046, 192301, 24008, "2020/07/31 12:00:00", 2.68, 802, "オレだって\nビーチベースボール選手だ\nどんな球だろうが\n全部スタンドまで飛ばしてやる", 2, "部員３", 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (24, 2, 0.0, 10046, 192301, 24009, "2020/07/31 12:00:00", 0.0, 803, "いい感じだ\nこれなら試合でも活躍できそうだ\n大暴れしてやる！", 2, "部員３", 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (24, 1, 0.0, 10046, 192501, 24010, "2020/07/31 12:00:00", 0.0, 501, "やった！", 1, "", 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (24, 1, 0.0, 10046, 192501, 24011, "2020/07/31 12:00:00", 0.0, 502, "勝ったよ！", 1, "", 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (24, 1, 0.0, 10046, 192501, 24012, "2020/07/31 12:00:00", 0.0, 503, "いい調子！", 1, "", 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (24, 6, 0.0, 10046, 113501, 24013, "2020/07/31 12:00:00", 5.33, 111, "あら～…もしかして\n勝っちゃったのかしら？\nみんなの練習を見ていたから\nかもしれないわね", 2, "ミサト", 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (24, 1, 0.0, 10046, 113501, 24014, "2020/07/31 12:00:00", 6.85, 112, "みんなの力になりたくて\n先生も頑張ってみました～！\nうまく投げられたみたいで\nよかったわ～！", 2, "ミサト", 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (24, 1, 0.0, 10046, 113501, 24015, "2020/07/31 12:00:00", 3.0, 113, "練習お疲れさま～！\n先生も協力できて\nとってもうれしいわ～♪\n次も頑張りましょうね～！", 2, "ミサト", 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (24, 1, 0.0, 10046, 192401, 24016, "2020/07/31 12:00:00", 6.11, 611, "まだ練習が足りねえみてえだな\nこれっぽっちも本気で\n投げてねえっつーの\nもう一回やんぞ！", 2, "ダイチ", 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (24, 1, 0.0, 10046, 192401, 24017, "2020/07/31 12:00:00", 6.75, 612, "ふん、当然の結果だな\n俺の球は、誰にも打てねえよ！\nまたやりてえっつーなら\nとことん付き合ってやるぜ！", 2, "ダイチ", 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (24, 2, 0.0, 10046, 192401, 24018, "2020/07/31 12:00:00", 0.0, 613, "おっしゃあ！\nこの勢いで全国に行ってやるぜ！\n全員三振で仕留めてやる！", 2, "ダイチ", 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (24, 2, 0.0, 10046, 113401, 24019, "2020/07/31 12:00:00", 4.52, 211, "きらーん☆\nハツネちゃんの大勝利なのだ～！\nみんながもっと上達できるように\n私もまだまだ頑張るからね！", 1, "ハツネ", 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (24, 2, 0.0, 10046, 113401, 24020, "2020/07/31 12:00:00", 3.89, 212, "やったあ！　私の勝ちだね！\nチアリーダーもピッチャーも\nハツネちゃんに任せてよ！", 1, "ハツネ", 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (24, 1, 0.0, 10046, 113401, 24021, "2020/07/31 12:00:00", 13.49, 213, "よお～し、この調子でもっと\n頑張ろう…と思ったけど\n超能力を使ったから…\n眠くなってきちゃった…すやぁ…", 2, "ハツネ", 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (24, 1, 0.0, 10046, 106501, 24022, "2020/07/31 12:00:00", 3.17, 311, "いい勝負だったぜ！\nたぎっちまって\nつい本気で投げちまったよ", 2, "カヤ", 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (24, 1, 0.0, 10046, 106501, 24023, "2020/07/31 12:00:00", 4.42, 312, "どうだ？\nオレ様のボールは熱かっただろ！\nま、でもおまえらの根性も\nなかなかのもんだったぜ", 2, "カヤ", 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (24, 6, 0.0, 10046, 106501, 24024, "2020/07/31 12:00:00", 2.89, 313, "なんだよ、そんなもんか？\nこっちはまだまだ投げたりねえ\nもっと勝負しようぜ！", 1, "カヤ", 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (24, 4, 0.0, 10046, 102301, 24025, "2020/07/31 12:00:00", 3.71, 421, "あとちょっとだったのに～！\n次こそぷうきちと一緒に\n勝ってみせるからね！", 3, "アヤネ", 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (24, 2, 0.0, 10046, 192201, 24026, "2020/07/31 12:00:00", 5.1, 721, "いい勝負だったね！\nでも、やっぱり悔しいな…\nもっと練習して\n今度は絶対に俺が勝つから！", 1, "アサヒ", 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (24, 1, 0.0, 10046, 192301, 24027, "2020/07/31 12:00:00", 4.34, 821, "ちっ…あと一歩足りなかったか\n次こそは絶対に勝つから\nそのつもりでいろ", 3, "部員３", 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (24, 1, 0.0, 10046, 192501, 24028, "2020/07/31 12:00:00", 0.0, 521, "いい勝負だったよ\nまたやろうね", 1, "", 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (24, 1, 0.0, 10046, 113501, 24029, "2020/07/31 12:00:00", 5.62, 101, "とってもよくできました～♪\n頑張ってくれて先生うれしいわ\nこれからも試合に向けて\n練習していきましょうね～", 2, "ミサト", -360.0, "2030/12/17 14:59:59");
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (24, 1, 0.0, 10046, 113501, 24030, "2020/07/31 12:00:00", 9.58, 102, "頑張った成果ね～！\nこのまま練習を続ければ\nもっとすごい成績を残せそうよ\n期待してますからね～！", 2, "ミサト", -360.0, "2030/12/17 14:59:59");
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (24, 2, 0.0, 10046, 113501, 24031, "2020/07/31 12:00:00", 0.0, 103, "いい子、いい子～♪\n頑張り屋さんのあなたを\nたっくさん褒めてあげますからね", 2, "ミサト", -360.0, "2030/12/17 14:59:59");
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (24, 2, 0.0, 10046, 113501, 24032, "2020/07/31 12:00:00", 9.13, 104, "夢に向けて、一歩前進できたわね\nこの調子で、夢を叶えましょう\n目指せ、全国大会～！", 1, "ミサト", -360.0, "2030/12/17 14:59:59");
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (24, 1, 0.0, 10046, 113501, 24033, "2020/07/31 12:00:00", 8.27, 105, "絶好調ね～♪\nきっと試合でも大活躍\n間違いなしだわ\n楽しみにしていますからね～！", 2, "ミサト", -360.0, "2030/12/17 14:59:59");
